import React from "react";
function App() {
  return (
    <div className="bg-blue-500 text-white p-4">
      <h1 className="text-2xl font-bold">Welcome to My Tailwind App!</h1>
      <p className="mt-2">Tailwind CSS is awesome!</p>
    </div>
  );
}

export default App;
